  input: TEXT,F3XN,,"The unitemized total of $36,736.28 represents total contributions
    from individuals who have not individually contributed more than $200 in the aggregate
    during the calendar year.  On January 2 and January 29, 2002 checks totalting
    $311each were received from the Metropolitan Atlanta Rapid Transit Authority (MARTA)
    and deposited into the ATU-COPE Voluntary Account.  The  invoices were paid twice
    by MARTA and refunded to on October 12, 2007.  Of the $311 no induvidual contributed
    over $200.  On April 26, 2004 a check for $496 was received from MARTA and deposited
    into the ATU-COPE Voluntary Account.  MARTA's Accounts Payable entered the invoice
    twice, each entry for $248.  A refund of $248 was issued on October 12, 2007.  Of
    the the $248 no individual contributed over $200.  "
